                       GroupId: item.dataset.id,
                       WidgetId: item.dataset.widgetId,
                       GroupTypeId: item.dataset.typeId,
                       TakeCount: takeCount,
                       Page: 0,
                       LobbyUrl: item.dataset.lobbyurl
                   }
                   item.dataset.page = 0;
