      <script type="text/javascript">
         $(document).ready(function () {
             var tt = '';
             var errortypes = $(tt);
             if (errortypes != ) {
                 if (errortypes.selector == "Recaptcha") {
                      $('#Captcha').addClass("input-validation-error");
                     $('.captcha_block').addClass("error_captcha");
                     $('#recaptchaError').removeClass("hidden").html('<span>Resimdeki karakterleri doğru olarak yeniden yazınız.</span>');
                 }
             }
         
         });
         
         
         $('.refresh-captcha').html('<i class="tf_refresh_icon"></i>');
         
         $(".refresh-captcha").on("click",
             function (e) {
                 var $parent = $(this).closest('div.login_captcha_block');
                 var $guid = $parent.find('input[name=captcha-guid]');
                 var $img = $parent.find('img');
         
                 $.getJSON('/Common/RefreshCaptcha',
                     {
                         guid: $guid.val(),
                         height: $img.attr('height'),
                         width: $img.attr('width')
                     },
                     function (data) {
                         $guid.val(data.Guid);
                         $img.attr('src', '/Common/Captcha?guid=' + data.Guid);
                     });
         
                 e.stopPropagation();
                 e.preventDefault();
                 return false;
             });
         
         $('#Captcha').on('blur keyup',
             function (event) {
                 anyError = ValidateCaptcha();
             });
         
         function ValidateCaptcha() {
         
             $('#loginError').html('');
              if ($('#Captcha').length) {
                 if ($('#Captcha').val().length != 5) {
                     $('#Captcha').addClass("input-validation-error");
                     $('#recaptchaError').removeClass("hidden").html('<span>G&#252;venlik kodu alanı boş veya verilen resimle uyuşmuyor.</span>');
                     return true;
                 } else {
                     $('#Captcha').removeClass("input-validation-error");
                     $('#recaptchaError').addClass('hidden').html('');
                     return false;
                 }
             }
         
         }
         
         
      </script>
