               <script>
                  var kycInProcessCount = Number('0');
                  var attachfiels = [];
                  var attachfielsname = [];
                  var attachfielssize = [];
                  var isSending = false;
                  var filescount = parseInt($("#pendingDocumentCount").val());
                  if (kycInProcessCount > 1) {
                  $('#js_attachfile_btn').attr('disabled', true);
                  }
                  
                  function AttachFile() {
                  if (kycInProcessCount > 1) {
                      return;
                  }
                  $('#file_upload').trigger('click');
                  }
                  var imgcount = 3 - parseInt($("#pendingDocumentCount2").val());
                  if (imgcount < 0) {
                  imgcount = 0;
                  }
                  if (parseInt($("#pendingDocumentCount2").val()) > 2) {
                  $('#js_attachfile_btn').prop('disabled', true);
                  }
                  
                  function SumofArray(total, num) {
                  return total + num;
                  }
                  
                  function FileUploadChange(elem, maxSizeText) {
                  if (kycInProcessCount > 1) {
                      return;
                  }
                  var filescount = parseInt($("#pendingDocumentCount").val());
                  $('.js_doc_msg_cont').empty();
                  var maxFilesSize = 15728640; // size 15MB
                  var currbtn = elem;
                  var files = $(currbtn)[0].files;
                  var reader = "";
                  var FielsName = "";
                  var item = "";
                  var filesize = 0;
                  var attachfielssizeSum = 0;
                  for (var i = 0; i < files.length; i++) {
                      var file = files[i];
                      if (files && file) {
                      var itemhtml = "";
                      var reader = new FileReader();
                      filesize = filesize + file.size;
                      if (attachfielssize.length > 0) {
                          attachfielssizeSum = attachfielssize.reduce(SumofArray) + file.size;
                      } else {
                          attachfielssizeSum = file.size;
                      }
                      if (attachfielssizeSum > maxFilesSize) {
                          alert(maxSizeText);
                          return false;
                      }
                      var extension = file.name.substring(file.name.lastIndexOf(".") + 1);
                      if (extension == "jpg" || extension == "jpeg" || extension == "png" || extension == "gif") {
                          FielsName = {
                          'FielsName': file.name
                          };
                          attachfielsname.push(FielsName);
                          attachfielssize.push(file.size);
                          reader.onload = function(event) {
                          var binaryString = reader.result;
                          itemhtml = ' < div class = "tl_mail_attachfiel flex attached_file_content" > ' + /*file.name +*/ ' < img style = "max-width:96px"
                          src = '+event.target.result+' > < i class = "tl_head_close close_img_icon"
                          onclick = "RemoveAttachFile(this,' + (attachfiels.length - 1) + ')" > < /i> < /div>';
                          $(".tl_mail_attachfiel_content").append(itemhtml);
                          item = {
                              'Fiels64Bit': /base64,(.+)/.exec(event.target.result)[1]
                          };
                          attachfiels.push(item);
                          }
                          filescount = filescount + 1;
                          $("#pendingDocumentCount").val(filescount);
                          imgcount = 3 - parseInt($("#pendingDocumentCount2").val());
                          if (imgcount < 0) {
                          imgcount = 0;
                          }
                          if ($("#pendingDocumentCount").val() > 3) {
                          $(".attached_all_files").append(" < div class = 'errorcount' > "+"
                              3 & #39;ten fazla dosya y&# 252; kleyemezsiniz!"+" < span > " + imgcount +" < /span> < /div>");
                              $('#js_attachfile_btn').prop('disabled', true);
                          }
                          } else {
                          alert('Allow only image.');
                          }
                          reader.readAsDataURL(file);
                      }
                      }
                  }
                  
                  function RemoveAttachFile(elem, index) {
                      $("#pendingDocumentCount").val($("#pendingDocumentCount").val() - 1);
                      if ($("#pendingDocumentCount").val() < 4 && parseInt('0') < 3) {
                      $(".errorcount").remove();
                      $('#js_attachfile_btn').prop('disabled', false);
                      }
                      attachfiels[index + 1] = -1;
                      attachfielsname[index + 1] = -1;
                      attachfielssize[index + 1] = 0;
                      $(elem).parent().remove();
                      $('#file_upload').val("");
                  }
                  
                  function RemoveFromArray() {
                      attachfielsname = jQuery.grep(attachfielsname, function(value) {
                      return value != -1;
                      });
                      attachfiels = jQuery.grep(attachfiels, function(value) {
                      return value != -1;
                      });
                      attachfielssize = jQuery.grep(attachfielssize, function(value) {
                      return value != 0;
                      });
                  }
                  
                  function SendBtnClick() {
                      if (kycInProcessCount > 1) {
                      return;
                      }
                      var docType = $("#DocumentType").children("option:selected").val();
                      RemoveFromArray();
                      if ($('.tl_mail_attachfiel').length > 0 && docType != "") {
                      if (!isSending) {
                          $("#send_btn_errors").html('');
                          isSending = true;
                          $('#js_attachfile_btn').prop('disabled', true);
                          SendClientDocuments();
                      }
                      } else {
                      if (docType == "") {
                          $(".tl_sel_custom_popup_reg_selected").css("border-bottom", "1px solid red");
                          $('#DocumentType').css("border-bottom", "1px solid red");
                          alert('Belge t&#252;r&#252;n&#252; se&#231;in');
                      } else {
                          alert('BROWSEDOCUMENTS');
                      }
                      return false;
                      }
                  }
                  $("#DocumentType").on('change', function() {
                      if ($(this).val() == "") {
                      $(".tl_sel_custom_popup_reg_selected").css("border-bottom", "1px solid red");
                      $(this).css("border-bottom", "1px solid red");
                      } else {
                      $(this).removeAttr("style");
                      $(".tl_sel_custom_popup_reg_selected").removeAttr("style");
                      }
                  });
                  
                  function SendClientDocuments() {
                      if (kycInProcessCount > 1) {
                      return;
                      }
                      var documenttype = $('#DocumentType').val();
                      var senddata = {
                      'Fielsname': attachfielsname,
                      'Fiels': attachfiels
                      };
                      $.ajax({
                      url: "/tr/Account/DocumentsUpload",
                      type: "POST",
                      data: {
                          message: senddata,
                          documenttype: documenttype,
                          pendingKYCCount: kycInProcessCount
                      },
                      datatype: "json",
                      success: function(result) {
                          if (result.Success) {
                          kycInProcessCount++;
                          $('.tl_mail_attachfiel').remove();
                          $('.js_doc_msg_cont').text('Verileriniz başarıyla eklendi').addClass('succsess_color').removeClass('error_color');
                          $("#pendingDocumentCount2").val(parseInt($("#pendingDocumentCount2").val()) + 1)
                          attachfiels = [];
                          attachfielsname = [];
                          attachfielssize = [];
                          } else {
                          $('.js_doc_msg_cont').text("Something wrong").addClass('error_color').removeClass('succsess_color');
                          }
                          isSending = false;
                          if (kycInProcessCount < 2 || '1093' != '1201') {
                          $('#js_attachfile_btn').prop('disabled', false);
                          }
                      }
                      });
                  }
                  $('#DocumentType').customSelect();
               </script>
