               <script type="text/javascript">
                  if('1093' == '1040'){
                          $('.tl_my_acc_cont_nav').remove();
                          $(".tl_my_acc_cont_content").css("width","calc((100%) - 0px)");
                                  }
                  
               </script>
               <script type="text/javascript">
                  function ellipsPaymentDesc() {
                          $('.tl_payment_head').each(function () {
                                          var desc = $(this).data("paymentDesc");
                              $(this).find('.tl_payment_desc').html(truncate.apply(desc, [190, true]));
                                      });
                                  }
                  
                                  function truncate(n, useWordBoundary) {
                                      var isTooLong = this.length > n,
                                          s_ = isTooLong ? this.substr(0, n - 1) : this;
                                      s_ = (useWordBoundary && isTooLong) ? s_.substr(0, s_.lastIndexOf(' ')) : s_;
                                      return isTooLong ? s_ + '&hellip;' : s_;
                                  }
                  
                      ;
                  
                      ellipsPaymentDesc();
                  $(document).off('click', '#deposit .tl_payment_block');
                  
                  //Autoopening koreanbanktransfer payment block when clicking on deposit section gambleparty
                  
                  if ('1093' == '1179') {
                      if ($('div.koreanbanktransfer')) {
                          setTimeout(() => {
                              $('div.koreanbanktransfer').trigger('click');
                          }, 2000);
                      }
                  }
                  
                  $(document).on('click', '#deposit .tl_payment_block', function (e) {
                          setCookie("username", "ss", 1);
                          e.preventDefault();
                          e.stopPropagation();
                          var $this = $(this);
                          var deptype = $(this).data('type');
                  
                          $(".tl_payment_body").css('display', 'block');
                  
                      if ($this.hasClass('betshop') || $this.hasClass('easypay') || $this.hasClass('telcellapp_visa_mastercard') || $this.hasClass('converse_terminal') || $this.hasClass('easypayapp_visa_mastercard')
                          || $this.hasClass('idram_terminal') || $this.hasClass('toto_terminal') || $this.hasClass('mobidram_terminal') || $this.hasClass('conversebank_app') || $this.hasClass('ardshinbank_app') || $this.hasClass('from_bank_account') || $this.hasClass('jzwesternunion')
                          || $this.hasClass('haypost') || $this.hasClass('smsuplata') || $this.hasClass('smsuplatapostpaid') || $this.hasClass('ackrilsdopuna')
                          || $this.hasClass('mobidram_terminal') || $this.hasClass('upay') || $this.hasClass('manualpayment') || $this.hasClass('idram_idbank_app')) {
                              $(".tl_payment_body").css('display', 'none');
                          }
                  
                          //Transfer to Sport part
                          if (deptype == 'transfer') {
                              var tabUrl = "/tr/Account/Transfers";
                              var tabId = "transfer_to_sport_tab";
                              if ('False'.toLocaleLowerCase() == 'true' && '' == 'yes' && tabId == 'deposit_tab') {
                                  tabClicked = false;
                                  return false;
                              }
                              loadTab(tabId, tabUrl, function () {
                                  tabClicked = false;
                                  activateTab(tabId);
                              });
                          }
                  
                          function activateTab(tabId) {
                              $('.tl_my_acc_nav_item').removeClass('active');
                              $('#' + tabId).addClass('active');
                          }
                  
                          function loadTab(tabId, tabUrl, callback) {
                              callback = callback || null;
                  
                              showSpinner();
                  
                              $('#tl_profile_content').fadeOut(300, function () {
                                  $(this).load(tabUrl, function (data) {
                  
                                      // check if is user is not logged, redirect
                                      if (!isLogged(data)) {
                                          location.href = "/";
                                          return false;
                                      }
                  
                                      hideSpinner();
                                      changeAccountPopupHeight(tabId);
                  
                                      $('#tl_profile_content').fadeIn(300);
                  
                                      if (callback) {
                                          callback();
                                      }
                                  });
                              });
                          }
                          //end
                  
                          if ($this.hasClass('active')) {
                              return false;
