                              if (paymeroMethod.includes("Bank Transfer")) {
                              $('#withdraw .tl_payment_block.paymerobanktransfer').css('display', 'block');
                              }
                          });
                          }
                      },
                      error: function(responce) {}
                      });
                  });
                  }
                  //end.
                  $('.tl_link').on('click', function(e) {
                  e.stopPropagation();
                  });
                  
                  function ResponseHandlingWeb(data, formId) {
                  var formCont = '#detailsDiv_' + formId.toLowerCase();
                  if (data.Success === true) {
                      $(formCont).find('.errormassage').html('');
                      $(formCont).find('.successmassage').html(data.Message);
                      $('#' + formId).find('input:enabled').val('');
                  } else {
