                  function CommissionCalculatorinfo() {
                  if ('1093' == '1086') {
                      $("#CommissionFee").remove();
                      $(".active input[id$='Amount']").closest("div.tl_payment_padd").find('.payment_lbl').append(`<span style='right: 0;position: absolute;' id='CommissionFee'>Shuma e komisionit <span class='CommissionFee'>0 </span>TRY</span>`);
                  } else if ('1093' == '2') {
                      $("#CommissionFee").remove();
                      $(".active input[id$='Amount']").closest("div.tl_payment_padd").find('.payment_lbl').append(`<span style='right: 0;position: absolute;' id='CommissionFee'>Commission <span class='CommissionFee'>0 </span>TRY</span>`);
                  } else if ('1093' != '1051') {
                      $("#CommissionFee").remove();
                      $(".active input[id$='Amount']").closest("div.tl_payment_padd").find('.payment_lbl').append(`<span style='right: 0;position: absolute;' id='CommissionFee'>Komisyon &#252;creti <span class='CommissionFee'>0 </span>TRY</span>`);
                  } else {
                      return false;
                  }
                  }
                  
                  function CommissionCalculator() {
                  if ('1093' != '1051') {
                      var CommissionFee = 0;
                      var Amount = $(".active input[id$='Amount']").val() * 1;
                      var Withdrawable = $(".active .Withdrawable").val() * 1;
                      var CreditPercentForUsed = $(".active .CreditPercentForUsed").val() * 1;
                      var CreditPercent = $(".active .CreditPercent").val() * 1;
                      var currentused = $(".active .playerUsed").val() * 1;
                      var currentUnUsed = $(".active .playerUnused").val() * 1;
                      var playerUsed = currentused / (1 + CreditPercentForUsed / 100);
                      var playerUnused = currentUnUsed / (1 + CreditPercent / 100);
                      if (Amount > 0 && (Withdrawable >= Amount)) {
                      if ((playerUsed - Amount) <= 0) {
                          if ((playerUnused - (Amount - playerUsed) <= 0)) {
                          CommissionFee = ((playerUsed * CreditPercentForUsed) / 100) + ((playerUnused * CreditPercent) / 100);
                          } else {
                          if (playerUnused > 0 && (playerUnused - (Amount - playerUsed)) >= 0) {
                              CommissionFee = ((playerUsed * CreditPercentForUsed) / 100) + (((Amount - playerUsed) * CreditPercent) / 100);
                          }
                          }
                      } else {
                          CommissionFee = (Amount * CreditPercentForUsed) / 100;
                      }
                      $(".active .CommissionFee").text(CommissionFee.toFixed(2));
                      }
                  } else {
                      return false;
                  }
                  }
                  
               </script>
