               <script type="text/javascript">
                  var isLinkedBonus = false;
                  
                  function checkLinkedBonus(linkedBonusId) {
                  var bonusId = $('*[data-bonus-id="' + linkedBonusId + '"]');
                  if (bonusId.length) {
                      isLinkedBonus = true;
                  } else {
                      isLinkedBonus = false;
                  }
                  }
                  //get bonus history
                  function getBonusHistory(showHistory) {
                  $("#pageNumber").val(0);
                  showLoading();
                  var type = $("#bonusHistoryItem").val();
                  $.ajax({
                      url: "/tr/Bonus/BonusHistory",
                      type: "POST",
                      data: "showHistory=" + showHistory + "&type=" + type,
                      datatype: "json",
                      success: function(result) {
                      // check if is user is not logged, redirect
                      if (!isLogged(result)) {
                          location.href = "/";
                          return false;
                      }
                      hideLoading();
                      $("#tl_profile_content").html(result);
                      }
                  });
                  }
                  $("#clientBonusReport").on("click", function() {
                  $("#pageNumber").val(0);
                  showLoading();
                  var type = $("#bonusHistoryItem").val();
                  $.ajax({
                      url: "/tr/Bonus/ClientBonusReport",
                      type: "POST",
                      //data: "showHistory=" + showHistory + "&type=" + type,
                      datatype: "json",
                      success: function(result) {
                      // check if is user is not logged, redirect
                      if (!isLogged(result)) {
                          location.href = "/";
                          return false;
                      }
                      hideLoading();
                      $("#tl_profile_content").html(result);
                      }
                  });
                  });
                  $(".details_btn").on("click", function() {
                  var that = $(this);
                  var clientBonusId = that.data("id");
                  $("#bonus_details_" + clientBonusId).toggle();
                  var isAlreadyLoaded = that.data("loaded");
                  var params = {};
                  params.bonusId = that.data("bonus-id");
                  if (!isAlreadyLoaded) {
                      $.ajax({
                      url: "/tr/Bonus/GetBonusGames",
                      type: "POST",
                      data: params,
                      datatype: "json",
                      success: function(result) {
                          if (result.ResponseCode == 0) {
                          that.data("loaded", true);
                          var cont;
                          if (!!result.ResponseObject && result.ResponseObject.length > 0) {
                              for (i = 0; i < result.ResponseObject.length; i++) {
                              cont = cont + `
                                                  <tr>
                                                      <td></td>
                                                      <td>` + result.ResponseObject[i].Name + `</td>
                                                      <td>` + result.ResponseObject[i].Percent + `</td>
                                                      <td>` + result.ResponseObject[i].MinAmount + `</td>
                                                      <td>` + result.ResponseObject[i].MaxAmount + `</td>
                                                      <td></td>
                                                  </tr>`;
                              }
                          } else {
                              cont = `
                                                  <tr>
                                                      <td></td>
                                                      <td colspan="4">No data availble</td>
                                                      <td>
                                                      </tr>`;
                          }
                          $("#bonus_details_" + clientBonusId + " tbody").html(cont);
                          } else {
                          //TODO Error handling
                          }
                      }
                      });
                  }
                  });
                  
                  function cancelBonus(clientBonusId, title) {
                  var popupMessage = "Bonusu iptal etmek istediğinize emin misiniz?";
                  changeStatus(clientBonusId, 4, title, popupMessage)
                  }
                  
                  function activateBonus(clientBonusId, title, linkedBonusId) {
                  checkLinkedBonus(linkedBonusId);
                  if (isLinkedBonus == true) {
                      var popupMessage = "Please note that after activating one of the two bonuses offered, the other one will be cancelled. Are you sure you want to activate this bonus?";
                  } else {
                      var popupMessage = "Teklifi aktif etmek istediğinize emin misiniz?";
                  }
                  changeStatus(clientBonusId, 2, title, popupMessage)
                  }
                  
                  function showConfirmationPopup(containerId, popupOptions, title, msg, callback, callbackParams) { //nik
                  callback = callback || false;
                  // setting options
                  var options = popupOptions || {};
                  // setting dialog options
                  var dialogOptions = {
                      clickOut: false,
                      showTitleBar: true,
                      showCloseButton: false,
                      width: 400,
                      responsive: true,
                      title: title,
                      dialogClass: "tl_popup_dialog",
                      modal: true,
                      draggable: false,
                      resizable: false,
                      show: {
                      effect: "fadeIn",
                      duration: 300
                      },
                      hide: {
                      effect: "fadeOut",
                      duration: 300
                      },
                      position: {},
                      close: function() {
                      $(this).remove();
                      },
                      buttons: {
                      "1": {
                          id: 'close',
                          text: 'Hayır',
                          click: function() {
                          $(this).dialog("close");
                          },
                          "class": "h-bg-secondary"
                      },
                      "2": {
                          id: 'continue',
                          text: 'Evet',
                          click: function() {
                          callback(callbackParams);
                          $(this).dialog("close");
                          },
                          "class": "h-bg-primary"
                      }
                      }
                  };
                  dialogOptions = $.extend(dialogOptions, options);
                  $(' < div > < /div>').appendTo("body").html(' < div class = "dialog_msg" > ' + msg + ' < /div>').dialog(dialogOptions);
                      $('.tl_popup_dialog.ui-dialog-buttons').addClass('tl_popup_dialog_styling');
                  }
                  
                  function changeStatus(clientBonusId, status, popupTitle, popupMessage) {
                      var params = {};
                      params.clientBonusId = clientBonusId;
                      params.status = status;
                      showConfirmationPopup('body', {
                      width: 450,
                      height: 'auto'
                      }, popupTitle, popupMessage, function() {
                      $.ajax({
                          url: "/tr/Bonus/ChangeStatus",
                          type: "POST",
                          data: params,
                          datatype: "json",
                          success: function(result) {
                          if (result.ResponseCode == 0) {
                              $(".histsearch_btn").trigger("click");
                          } else {
                              //TODO Error handling
                          }
                          }
                      });
                      }, params);
                  }
               </script>
