                        $.validator.unobtrusive.adapters.addSingleVal("greaterdate", "other");
                        $.validator.addMethod("greaterdate", function(endVal, element, other) {
                        var modelPrefix = element.name.substr(0, element.name.lastIndexOf(".") + 1);
                        var startVal = $("[name='" + modelPrefix + other + "']").val();
                        if (endVal && startVal) {
                            var split = startVal.split('/');
                            var startDate = new Date(split[2], split[1] - 1, split[0]);
                            split = endVal.split('/');
                            var endDate = new Date(split[2], split[1] - 1, split[0]);
                            if (startDate >= endDate) {
                            return false;
                            }
                        }
                        return true;
                        });
                        
                        function initPeriod() {
                        $('#period').on('change', function() {
                            var selectedValue = parseInt($(this).val());
                            var startDate = $("#start-date");
                            var endDate = $("#end-date");
                            var allDates = $("#start-date, #end-date");
                            var date;
                            if (selectedValue == 3) date = '12/10/2023';
                            else if (selectedValue == 2) date = '28/10/2023';
                            else if (selectedValue == 1) date = '04/11/2023';
                            else if (selectedValue == 0) date = '10/11/2023';
                            var isDisabled = selectedValue != 4;
                            if (isDisabled) {
                            allDates.attr('readonly', 'readonly');
                            startDate.datepicker('setDate', date);
                            startDate.attr('value', date);
                            allDates.addClass('disabled');
                            date = '11/11/2023';
                            endDate.datepicker('setDate', date);
                            endDate.attr('value', date);
                            } else {
                            allDates.removeAttr('readonly');
                            allDates.removeClass('disabled');
                            }
                        });
                        $('#period').change();
