            <script type="text/javascript">
               $('.confirmdepid').on('click', function() {
                   var depositId = $(this).attr('depositId');
                   var params = $.param({
                   id: depositId
                   });
                   $.ajax({
                   url: "/tr/Account/ConfirmDeposit",
                   type: "POST",
                   data: params,
                   datatype: "json",
                   success: function(result) {
                       if (result.Success) {
                       $(".paging a.active").trigger('click');
                       return;
                       }
                   }
                   });
               });
               $('.contwithdraw').on('click', function() {
                   var withdrawId = $(this).attr('withdrawId');
                   var amount = $(this).attr('amount');
                   var params = $.param({
                   withid: withdrawId,
                   amountwithd: amount
                   });
                   $.ajax({
                   url: "/tr/Account/GetPayboxUrl",
                   type: "POST",
                   data: params,
                   datatype: "json",
                   success: function(result) {
                       if (result.Success) {
                       document.location.href = result.Message;
                       return;
                       }
                   }
                   });
               });
               $('.cancel-withdrawal-link').on('click', function() {
                   var withdrawalId = $(this).attr('withdrawalId');
                   var paymentid = $(this).attr('paymentid');
                   var selItem = $(this);
                   var params = $.param({
                   id: withdrawalId,
                   paymentid: paymentid,
                   });
                   $.ajax({
                   url: "/tr/Account/CancelWithdrawal",
                   type: "POST",
                   data: params,
                   datatype: "json",
                   success: function(result) {
                       selItem.parent().html(result.Message);
                   }
                   });
               });
               
               function ShowQR(QRCode) {
                   $("#QRImg-withdrawal-history").attr("src", QRCode)
                   $("#popup-QRCode-withdrawal-history").css("display", "flex");
               }
               $('#close-popup-QRCode-withdrawal-history').on('click', function(e) {
                   $('#popup-QRCode-withdrawal-history').css("display", "none");
               })
            </script>
            <script type="text/javascript">
               $(".details_btn").click(function() {
                   attrid = $(this).attr("id");
                   var parent = $("div[class$='" + attrid + "']");
                   parent.toggle();
                   $(this).toggleClass('arrow_rotate');
                   var withdrawalId = attrid;
                   var params = $.param({
                   id: withdrawalId
                   });
                   if (!$(this).hasClass('called')) {
                   $.ajax({
                       url: "/tr/Account/GetPaymentRequestsCommission",
                       type: "POST",
                       data: params,
                       datatype: "json",
                       success: function(result) {
                       if (result.Success) {
                           $("[class^='commistionblock'] [id$='" + attrid + "']").empty();
                           $("#used_" + attrid).append("Kullanılan " + result.data.UsedBalance + ' TRY');
                           $("#usedfee_" + attrid).append("İşlem &#220;creti " + result.data.UsedFeePercent + " %");
                           $("#commamount_" + attrid).append(result.data.UsedFeeAmount + ' TRY');
                           $("#unused_" + attrid).append("Kullanılmayan " + result.data.UnUsedBalance + ' TRY');
                           $("#unusedfee_" + attrid).append("İşlem &#220;creti " + result.data.UnUsedFeePercent + " %");
                           $("#uncommamount_" + attrid).append(result.data.UnUsedFeeAmount + ' TRY');
                       } else {
                           createToast('error', 'Error', result.Message, 4000);
                       }
                       }
                   });
                   $(this).addClass("called");
                   }
               });
            </script>
