               <script type="text/javascript">
                  $(document).on('click', '#js_verify_qr_code', function(e) {
                  e.preventDefault();
                  e.stopPropagation();
                  var code = $('#js_qr_code').val();
                  $('#js_switcher_msg').html('');
                  $('#js_messages').html('');
                  if (code == '') {
                      $('#js_messages').removeClass('valid').addClass('invalid');
                      $('#js_messages').html('Code Can&#39;t be empty!');
                  } else {
                      $.ajax({
                      url: "/Account/EnableTwoFa",
                      type: "POST",
                      data: "code=" + code,
                      datatype: "json",
                      success: function(result) {
                          if (result.Success) {
                          $('#js_messages').removeClass('invalid').addClass('valid');
                          $('#js_twoFa_switcher_text').html('A&#231;ık');
                          document.getElementById('js_twoFa_switcher').checked = true;
                          $('#js_qr_cont').addClass('hidden');
                          $('#js_howTo_setup_cont').addClass('hidden');
                          } else {
                          $('#js_messages').removeClass('valid').addClass('invalid');
                          }
                          $('#js_messages').html(result.Message);
                      }
                      });
                  }
                  });
                  $(document).on('click', '#js_getCode_btn', function(e) {
                  e.preventDefault();
                  e.stopPropagation();
                  if ($('#js_manual_code').hasClass('hidden')) {
                      $('#js_manual_code').removeClass('hidden');
                  } else {
                      $('#js_manual_code').addClass('hidden');
                  }
                  });
                  
                  function switcherCheck() {
                  var checkBox = document.getElementById("js_twoFa_switcher");
                  $('#js_messages').html('');
                  $('#js_switcher_msg').html('');
                  if (checkBox.checked == false) {
                      $.ajax({
                      url: "/Account/DisableTwoFa",
                      type: "POST",
                      datatype: "json",
                      success: function(result) {
                          if (result.Success) {
                          $('#js_manual_entry_key').val(result.ManualEntryKey);
                          $('#js_qr_code').val('');
                          $('#js_qr_src').attr('src', 'data:image/png;base64, ' + result.QrCodeSetupImageUrl);
                          $('#js_messages').removeClass('invalid').addClass('valid');
                          $('#js_twoFa_switcher_text').html('Kapalı');
                          $('#js_qr_cont').removeClass('hidden');
                          $('#js_howTo_setup_cont').removeClass('hidden');
                          } else {
                          $('#js_messages').removeClass('valid').addClass('invalid');
                          }
                          $('#js_messages').html(result.Message);
                      }
                      });
                  } else {
                      $('#js_switcher_msg').html('2 Aşamalı G&#252;venliğin aktif olması i&#231;in &#246;ncelikle QR Kodunu Taratın sonrasında gerekli adımları tamamlayın.');
                      document.getElementById('js_twoFa_switcher').checked = false;
