               <script>
                  var promoClicked = false;
                  $.validator.unobtrusive.parse($('#PromoCodeForm'));
                  $('#PromoCodeForm').validate();
                  $('#promo_check').on('click', function(e) {
                  if (promoClicked) {
                      return false;
                  }
                  promoClicked = true;
                  if ($('#PromoCodeForm').valid()) {
                      loaderInsideShowHide('promo_check', true);
                      $.ajax({
                      url: "/tr/Account/CheckPromoCode",
                      type: "POST",
                      data: $('#PromoCodeForm').serialize(),
                      datatype: "json",
                      success: function(result) {
                          if (result.Success) {
                          $("#PromoContent").hide();
                          $("#back_btn").removeClass('hidden');
                          var promoResult = "";
                          if (result.BonusType == 4) { // RealMoney
                              promoResult += " < div class = 'promoResult' > ";
                              promoResult += " < div class = 'prizeText' > " + result.Message + " < /div>";
                              promoResult += " < /div>";
                          } else if (result.BonusType == 5) { // BonusCampaign
                              let imgUrl = 'https://cdn-plat.apidigi.com/plat/prd/';
                              imgUrl += result.ProductType == 2 ? 'Img/Bonus/Sport.png' : 'Img/Bonus/Casino.png';
                              promoResult += " < div class = 'promoResult' > ";
                              promoResult += " < div class = 'promoImg' > < img src = "+ imgUrl +" / > < /div>";
                              promoResult += " < div class = 'prizeText' > " + result.Message + " < /div>";
                              promoResult += ' < a class = "tl_btn h-bg-primary promocode_btn"
                              href = "/bonuscampaign" > See Bonus < /a>';
                              promoResult += " < /div>";
                          } else { // FreeSpin
                              promoResult += " < div class = 'promoResult' > ";
                              promoResult += " < div class = 'promoImg' > < img src = " + result.Image + " / > < /div>";
                              promoResult += " < div class = 'prizeText' > " + result.Message + " < /div>";
                              promoResult += "  < a class = 'tl_btn h-bg-primary promocode_btn'
                              ";
                              if ('True'.toLocaleLowerCase() == 'true') {
                              promoResult += "href=/play/real/" + (result.LobbyUrl == '' ? result.Url : result.Url + "-" + result.LobbyUrl) + ">Oyna</a>";
                              } else {
                              promoResult += "href=/games/playreal/" + result.Url + ">Oyna < /a>";
                              }
                              promoResult += " < /div>";
                          }
                          $("#PromoResult").append(promoResult);
                          } else {
                          createToast('error', 'Error', result.Message);
                          }
                          promoClicked = false;
                          loaderInsideShowHide('promo_check', false);
                      }
                      });
                  } else {
                      promoClicked = false;
                  }
                  });
                  $("#back_btn").click(function() {
                  $(this).addClass('hidden');
                  $("#PromoResult").empty();
                  $("#PromoCode").val('');
                  $("#PromoContent").show();
                  });
                  $('#PromoContent').on('keypress', function(e) {
                  if (e.keyCode == 13) {
                      e.stopPropagation();
                      e.preventDefault();
                      $('#promo_check').trigger('click');
                  }
                  });
               </script>
