                         </svg>
                         <p class="no-result__text">Mesaj bulunmamakta</p>
                     </div>`;
         
         function getMessagesPaging(appendLast, pgData) {
             $.ajax({
                 url: "/tr/Account/GetInboxMessagesPaging",
                 type: "POST",
                 data: pgData,
                 datatype: "json",
                 success: function (result) {
                     let html = '';
                     let msgs = result.Data.Messages;
                     if (msgs && msgs.length > 0) {
                         if (appendLast) {
                             msgs.splice(0, 9);
                         }
                         for (let i = 0; i < msgs.length; i++) {
                             let subject = msgs[i].LastType != null ? "RE " + msgs[i].Subject : msgs[i].Subject;
                             let sendby = msgs[i].LastType != null ? msgs[i].LastSource : msgs[i].Source;
                             let date = msgs[i].LastType != null ? 'Last Update:' : 'Tarih';
                             html += `
                                 <div class="inbox-popup__item js_msg_item ${(!msgs[i].Read ? "unread" : "read")}" data-message-id="${msgs[i].Id}">
                                 <div class="item__head">
                                         <p class="item__title" title="${subject}">
                                             ${subject}
                                         </p>
                                         <div class="js_delete_msg" data-delete-message-id="${msgs[i].Id}">
                                             <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                 <path d="M14.12 19H5.96998C5.44998 19 5.00998 18.6 4.96998 18.08L4.03998 6H16.04L15.11 18.08C15.07 18.6 14.64 19 14.12 19Z" fill="#E8E8E8" ></path>
                                                 <path d="M16 3H12.45C12.22 1.86 11.21 1 10 1C8.79 1 7.78 1.86 7.55 3H4C3.45 3 3 3.45 3 4C3 4.55 3.45 5 4 5H16C16.55 5 17 4.55 17 4C17 3.45 16.55 3 16 3Z" fill="#E8E8E8" ></path>
                                             </svg>
                                         </div>
                                         <div class='js_dot_icon ${!msgs[i].Read ? "item__indicator" : "item__indicator item__indicator--checked"}'></div>
         
                                     </div>
                                     <div class="item__subtitle">
                                         <p class="item__intro">
                                             G&#246;nderen ${sendby}
                                         </p>
                                     </div>
                                     <div class="item__footer">
                                         <p class="item__id">ID: <span class="primary-text">${msgs[i].Id}</span></p>
                                         <div class="item__date">
                                             <div class="tl_mail_details_title">
                                                 ${date}
                                             </div>
                                             <div class="tl_mail_details js_last_update_time">
                                                 ${msgs[i].LastUpdateTime}
                                             </div>
         
                                         </div>
                                     </div>
                                     </div>`;
         
                         }
                         $('#js_msgs_cont-inner').append(html);
                     }
                     hasNext = result.Data.HasNext;
                 }
             });
         }
         
         function createSentMessage(data) {
             let html = '';
             html += `
                                 <div class="inbox-popup__item js_msg_item " data-message-id="${data.id}">
                                 <div class="item__head">
                                         <p class="item__title" title="${data.subject}">
                                             ${data.subject}
                                         </p>
                                         <div class="js_delete_msg" data-delete-message-id="${data.id}">
                                             <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                 <path d="M14.12 19H5.96998C5.44998 19 5.00998 18.6 4.96998 18.08L4.03998 6H16.04L15.11 18.08C15.07 18.6 14.64 19 14.12 19Z" fill="#E8E8E8" ></path>
                                                 <path d="M16 3H12.45C12.22 1.86 11.21 1 10 1C8.79 1 7.78 1.86 7.55 3H4C3.45 3 3 3.45 3 4C3 4.55 3.45 5 4 5H16C16.55 5 17 4.55 17 4C17 3.45 16.55 3 16 3Z" fill="#E8E8E8" ></path>
                                             </svg>
                                         </div>
                                         <div class='item__indicator item__indicator--checked'></div>
         
                                     </div>
                                     <div class="item__subtitle">
                                         <p class="item__intro">
                                            G&#246;nderen You
                                         </p>
                                     </div>
                                     <div class="item__footer">
                                         <p class="item__id">ID: <span class="primary-text">${data.id}</span></p>
                                         <div class="item__date">
                                             <div class="tl_mail_details_title">
                                                 Tarih
                                             </div>
                                             <div class="tl_mail_details js_last_update_time">
                                                 ${data.date}
                                             </div>
         
                                         </div>
                                     </div>
                                     </div>`;
             return html;
         }
         
         $(function () {
             function loadMoreMsgOnScroll(element, scrolledElement) {
                 if (hasNext && element && (scrolledElement.offsetHeight <= (element.scrollTop + element.offsetHeight + 200))) {
                     hasNext = false;
                     pagingData.page += 1;
                     getMessagesPaging(false, pagingData);
                 }
             }
         
             document.getElementById('js_msgs_cont').addEventListener('scroll', function () {
                 loadMoreMsgOnScroll(this, document.getElementById('js_msgs_cont-inner'));
             });
             $(document).on('click', '.inbox-popup__item', function (e) {
                 var $mailItems = $('.inbox-popup__item');
                 var $mailItem = $(this);
                 var $msgCont = $('.inbox-popup__item-inner .inner__body');
                 if ($mailItem.hasClass('unread')) {
                     unreadMail($mailItem);
                 }
         
                 if (!$mailItem.hasClass('active')) {
                     GetMessageById($mailItem.data('messageId'));
         
                     $mailItems.removeClass('active');
                     $mailItem.addClass('active');
                     $mailItem.find('.item__indicator').addClass('item__indicator--checked');
                 }
             });
         
             var unreadMail = function (mailItem) {
                 var $mailItem = mailItem;
                 $mailItem.removeClass('unread').addClass('read');
                 var inboxCount = parseInt($('#inboxCount').text());
                 inboxCount = (!isNaN(inboxCount) && (inboxCount - 1) > 0) ? inboxCount - 1 : null;
         
                 if (inboxCount) {
                     $('.js_unread_count').show();
                     $('#inboxCount').text(inboxCount);
                     $('.js_unread_count').text(inboxCount);
                 } else {
                     $('.js_unread_count').hide();
                     $('#inboxCount').hide();
                 }
             };
         
             $('.inbox-popup__item').first().trigger('click');
         
         });
         
         function FileUploadChange(elem,maxSizeText) {
             var maxFilesSize = 15728640; // size 15MB
             var currbtn = elem;
             var files = $(currbtn)[0].files;
             var file = files[0];
         
             if (files && file) {
                 var data = null;
                 var reader = new FileReader();
                 if (file.size > maxFilesSize) {
                     alert(maxSizeText);
                     return false;
                 }
         
                 reader.onload = function () {
                     var binaryString = reader.result;
                     data = binaryString.substr(binaryString.indexOf(',') + 1);
                     var extension = file.name.substring(file.name.lastIndexOf(".") + 1);
                     if (extension == "jpg" || extension == "jpeg" || extension == "png") {
                         var item = { 'Extension': extension, 'Data': data, 'Name': file.name };
                         attachfiels.push(item);
                         var itemhtml = '<div class="tl_mail_attachfiel flex">' + file.name + '<i class="tl_mail_attachfiel_delete" onclick="RemoveAttachFile(this,' + (attachfiels.length - 1) + ')"></i></div>';
                         $(currbtn).parent().find(".tl_mail_attachfiel_content").append(itemhtml);
                     }
                     else {
                         alert('Allow only image.');
                     }
         
                 }
                 reader.readAsDataURL(file);
         
             }
         }
         
         function NewMessageBtnClick() {
             var $mailItems = $('.inbox-popup__item');
             GetMessageById(null, true);
             $mailItems.removeClass('active');
         }
         
         function GetMessageById(messageId, newmsg) {
             var $msgCont = $('.inbox-popup__item-inner .inner__body');
             $msgCont.fadeOut(500, function () {
                 $.ajax({
                     url: "/tr/Account/ReadInboxMessage",
                     type: "POST",
                     data: { id: messageId, newMsg: newmsg },
                     datatype: "json",
                     success: function (result) {
                         attachfiels = [];
                         $msgCont.html(result);
                         $msgCont.fadeIn(500);
                     }
                 });
             });
         
         }
         
         function ReadAllMessages(messageId) {
             $.ajax({
                 url: "/tr/Account/ReadInboxMessage",
                 type: "POST",
                 data: { id: messageId },
                 datatype: "json",
                 success: function (result) {
                     $('.js_msg_item').removeClass('unread').addClass('read');
                     $('.item__indicator').addClass('item__indicator--checked');
                     $('#inboxCount').hide();
                     $('.js_unread_count').hide();
                 }
             });
         }
         
         function Showmessage(elem) {
             var $mailContent = $(elem).next(".tl_mail_message_cont");
         
             if ($mailContent.hasClass('hide')) {
                 $mailContent.removeClass('hide');
             }
             else {
                 $mailContent.addClass('hide');
             }
         }
         
         function SendBtnClick() {
             if (!isSending) {
                 $("#send_btn_errors").html('');
                 isSending = true
                 var subject = $("#send_subject").val();
                 var parentId = $("#send_parentId").val();
                 var message = $("#send_message").val();
                 if (message.trim() != '' && subject.trim() != '') {
                     SendClientMessage(subject, message, parentId);
                 }
                 else {
                     if (subject==null || subject.trim() == '') {
                         $("#send_btn_errors").append('Please fill in the subject field'+'. ');
                     }
                     if (message==null || message.trim() == '') {
                         $("#send_btn_errors").append('Please fill in the message field'+'. ');
                     }
                     isSending = false;
                 }
             }
         }
         
         function SendClientMessage(subject, message, parentId) {
             var senddata = { 'Subject': subject, 'Message': message, 'ParentId': parentId, 'Fiels': attachfiels };
             $.ajax({
                 url: "/tr/Account/SendClientMessage",
                 type: "POST",
                 data: { message: senddata },
                 datatype: "json",
                 success: function (result) {
                     isSending = false;
                     if (result.Success) {
                         if (result.parentId != null) {
                             let msgItem = $('div[data-message-id="' + result.parentId + '"]')[0];
                             $($(msgItem).find('.js_subject_detail')[0]).html("RE: " + result.subject);
                             $($(msgItem).find('.js_last_update_time')[0]).html(result.date);
                             $(msgItem).removeClass('active');
                             $(msgItem).trigger("click");
                         } else {
                             $('#js_msgs_cont-inner').prepend(createSentMessage(result));
                             $($('.js_msg_item')[0]).trigger("click");
                         }
                         $('.js_inbox_items').show();
                         $('#send_btn').removeAttr("onclick");
                     }
                 }
             });
         }
         
         var replySvg = `<svg width="25" height="24" viewBox="0 0 25 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                             <path d="M14.5 9V5L21.5 12L14.5 19V14.9C9.5 14.9 6 16.5 3.5 20C4.5 15 7.5 10 14.5 9Z" fill="#F88543" ></path>
                         </svg>`;
         
         function ReplyBtnClick(elem) {
             var $sendContent = $(elem).parents(".tl_mail_row").next(".tl_mail_message_cont");
         
             if ($sendContent.hasClass('hide')) {
                 $sendContent.removeClass('hide');
                 $(elem).text('İptal et');
             }
             else {
                 $sendContent.addClass('hide');
                 $(elem).text('Cevapla');
                 $("#reply_btn").append(replySvg);
                 $(".tl_mail_send_area").val('');
             }
         }
         
         function AttachFile() {
             $('#file_upload').trigger('click');
         }
         
         function RemoveAttachFile(elem,index) {
             attachfiels.splice(index, 1);
             $(elem).parent().remove();
         }
         
         function DeleteMessage(msgId) {
             $.ajax({
                 url: "/tr/Account/DeleteInboxMessage",
                 type: "POST",
                 data: { messageId: msgId },
                 datatype: "json",
                 success: function (result) {
                     if (result.Success) {
                         allowDelete = true;
                         if (msgId == null) {
                             $('.js_msg_item ').remove();
                             $('#inboxCount').hide();
                             $('.js_inbox_items').hide();
                             $('#msg_cont').html(noMsgHtml);
                             $('.js_unread_count').hide();
                         } else {
                             let elem = $('div[data-message-id="' + msgId + '"]')[0];
                             if ($(elem).hasClass('active')) {
                                 $(elem).next().trigger('click');
                             }
                             if ($(elem).hasClass('unread')) {
                                 let unreadMsgCount = parseInt($('#inboxCount').text());
                                 unreadMsgCount = (!isNaN(unreadMsgCount) && (unreadMsgCount - 1) > 0) ? unreadMsgCount - 1 : null;
                                 if (unreadMsgCount) {
                                     $('#inboxCount').show();
                                     $('#inboxCount').text(unreadMsgCount);
                                     $('.js_unread_count').text(unreadMsgCount);
                                 } else {
                                     $('#inboxCount').hide();
                                     $('.js_unread_count').hide();
                                 }
                             }
                             elem.remove();
                             let msgItems = $('.js_msg_item');
                             if (msgItems.length == 0) {
                                 $('.js_inbox_items').hide();
                                 $('#msg_cont').html(noMsgHtml);
                             }
                             if (msgItems.length < 10) {
                                 getMessagesPaging(true, { page: 1, takeCount: 10 });
                             }
                         }
                     }
                 }
             });
         }
         
         $(document).off('click', '.js_delete_msg');
         
         $(document).on('click', '.js_delete_msg', function (e) {
             e.preventDefault();
             e.stopPropagation();
             if (allowDelete) {
                 var msgId = $(this).attr('data-delete-message-id');
                 DeleteMessage(msgId);
             }
         });
         
         $(document).on('click', '.deleteAll_icon', function (e) {
             e.preventDefault();
             e.stopPropagation();
             $('.are_you_sure').show();
             $('.are_you_sure__content').html('B&#252;t&#252;n mesajları silmek istediğine emin misin?');
             $('.read_messages').hide();
             $('.delete_messages').show();
             if ('False'.toLocaleLowerCase() == 'true') {
                 $('body').addClass('ofh');
             }
         });
         
         $(document).on('click', '.readAll_icon', function (e) {
             e.preventDefault();
             e.stopPropagation();
             $('.are_you_sure').show();
             $('.are_you_sure__content').html('B&#252;t&#252;n mesajları okunmuş olarak işaretlemek istediğine emin misin?');
             $('.delete_messages').hide();
             $('.read_messages').show();
             if ('False'.toLocaleLowerCase() == 'true') {
                 $('body').addClass('ofh');
             }
         });
         
         $(document).on('click', '.delete_messages', function (e) {
             e.preventDefault();
             e.stopPropagation();
             DeleteMessage(null);
             $('.are_you_sure').hide();
             if ('False'.toLocaleLowerCase() == 'true') {
                 $('body').removeClass('ofh');
             }
         });
         
         $(document).on('click', '.read_messages', function (e) {
             e.preventDefault();
             e.stopPropagation();
             ReadAllMessages(null);
             $('.are_you_sure').hide();
             if ('False'.toLocaleLowerCase() == 'true') {
                 $('body').removeClass('ofh');
             }
         });
         
         $(document).on('click', '.are_you_sure__no', function (e) {
             e.preventDefault();
             e.stopPropagation();
             $('.are_you_sure').hide();
             if ('False'.toLocaleLowerCase() == 'true') {
                 $('body').removeClass('ofh');
             }
         });
         
         $('#js_push_not').off('click');
         $('#js_push_not').on('click', function (e) {
             if (allowPushNtfc) {
                 GetPushNot();
             }
         })
         function GetPushNot() {
             showSpinner();
             allowPushNtfc = false;
             $.ajax({
                 url: "/tr/Account/PushNotifications",
                 type: "Get",
                 datatype: "json",
                 success: function (result) {
                     $('#inboxContent').html(result);
                     allowPushNtfc = true;
                     hideSpinner();
                 }
             });
         }
         
      </script>
