<script>
    // Document hazır olduğunda jQuery kullanarak işlemleri gerçekleştir
    $(document).ready(function () {
        // "Devam" düğmesine tıklandığında
        $('#js_cnt_btn').click(function () {
    // Şu anki adımın ID'sini bul
    var currentStep = $('.D_reg_step.showStep');
    
    // Eğer şu anki adım varsa devam et
    if (currentStep.length > 0) {
        var currentStepId = currentStep.attr('id');
        // Şu anki adımın sıra numarasını al
        var currentStepNumber = parseInt(currentStepId.replace('Step', ''));
        
        // Şu anki adımın sınıfını kaldır
        currentStep.removeClass('showStep');

        // Bir sonraki adımın ID'sini oluştur
        var nextStepId = '#Step' + (currentStepNumber + 1);

        // Bir sonraki adımın sınıfını ekle
        $(nextStepId).addClass('showStep');

        // Eğer bir sonraki adım Step3 ise
        if (nextStepId === '#Step3') {
            // register_next_step sınıfını ekle
            $('.register_next_step').addClass('hidden');
            $('.register_next_step2').removeClass('hidden');
        } else {
            // Step3 değilse, register_next_step2 sınıfını kaldır
            $('.register_next_step2').addClass('hidden');
            $('.register_next_step').removeClass('hidden');
        }
    }
});


        // "Geri" düğmesine tıklandığında
        $('#js_back_btn').click(function () {
            // Şu anki adımın ID'sini bul
            var currentStep = $('.D_reg_step.showStep');
            
            // Eğer şu anki adım varsa devam et
            if (currentStep.length > 0) {
                var currentStepId = currentStep.attr('id');
                // Şu anki adımın sıra numarasını al
                var currentStepNumber = parseInt(currentStepId.replace('Step', ''));

                // Şu anki adımın sınıfını kaldır
                currentStep.removeClass('showStep');

                // Bir önceki adımın ID'sini oluştur
                var prevStepId = '#Step' + (currentStepNumber - 1);
                // Bir önceki adımın sınıfını ekle
                $(prevStepId).addClass('showStep');
            }
        });
    });
</script>
<script type="text/javascript">

    $.validator.unobtrusive.parse($('#registerForm'));
    $('#registerForm').validate();
    $($('#City > option')[0]).val('');
    var allInpts = $('#registerForm').find('input');
    var allSelects = $('#registerForm').find('select');
    var fromWhere = 'First';
    var inps = $('#' + fromWhere).find('input');
    var sels = $('#' + fromWhere).find('select');
    var isValid = true;
    var allowRegBtnClick = true;
    var allowResend = true;

    allInpts.on('keyup', function () {
        ValidateFields(this);
    });

    allInpts.on('blur', function () {
        ValidateFields(this);
    });

    allInpts.on('focus', function () {
        if ($(this).val() === '' && !$(this).parents('.form-group').hasClass('input_validation_fail') && !$(this).parents('.form-group').hasClass('input_validation_pass')) {
            $(this).parents('.form-group').addClass('input_validation_warn');
        }
    });

    allSelects.on('change', function () {
        if ($(this).attr('id') != 'countryNumber') {
            ValidateSelects(this);
        }
    });

    $('#js_cnt_btn').on('click', function () {
        inps = $('#' + fromWhere).find('input');
        sels = $('#' + fromWhere).find('select');
        $('#CurrentStep').val(fromWhere);
        $("#HidNumberCode").val($('#countryNumber :selected').text());
        if (isCurrentStepFieldsValid() == true && allowRegBtnClick) {
            allowRegBtnClick = false;
            showSpinner();
            $.ajax({
                url: "/tr/Registration/RegisterT7",
                type: "POST",
                data: $('#registerForm').serialize(),
                datatype: "json",
                success: function (result) {
                    handleRegisterResponse(result);
                    hideSpinner();
                    allowRegBtnClick = true;
                }
            });
        }
    });

    $('#js_back_btn').on('click', function () {
        if (fromWhere == 'Second') {
            $('#js_cnt_btn').html('Devam');
            $('#js_back_btn').parent().addClass('hidden');
            $('#VerificationCode').val('');
            $('#VerificationCode').parents('.form-group').removeClass('input_validation_fail');
            $('#VerificationCode').removeClass('input-validation-error');
            $('span[data-valmsg-for="VerificationCode"]').html('');
            fromWhere = 'First';
        } else if (fromWhere == 'Third') {
            $('#js_cnt_btn').html('Kodu Doğrula');
            fromWhere = 'Second';
        }else if (fromWhere == 'Fourth') {
            $('#js_cnt_btn').html('Devam');
            fromWhere = 'Third';
        }
        $('.D_reg_step').removeClass('showStep');
        $('#' + fromWhere).addClass('showStep');
        $('#CurrentStep').val(fromWhere);
    });

    $('.tl_input_popup_reg, .tl_input_popup').keypress(function (e) {
        if (e.which == 13) {
            $('#js_cnt_btn').trigger('click');
        }
    });

    $('#js_resend_btn').on('click', function () {
        if (allowResend) {
            allowResend = false;
            $('#VerificationCode').val('');
            $('#VerificationCode').parents('.form-group').removeClass('input_validation_fail');
            $('#VerificationCode').removeClass('input-validation-error');
            $('span[data-valmsg-for="VerificationCode"]').html('');
            $('#CurrentStep').val('First');
            showSpinner();
            $.ajax({
                url: "/tr/Registration/RegisterT7",
                type: "POST",
                data: $('#registerForm').serialize(),
                datatype: "json",
                success: function (result) {
                    handleRegisterResponse(result);
                    hideSpinner();
                    allowResend = true;
                }
            });
        }
    });

    $('#Terms').on('click', function () {
        ValidateTerms1();
    });

    function ValidateFields(field) {
        isValid = true;
        $(field).parents('.form-group').removeClass('input_validation_fail');
        $(field).parents('.form-group').removeClass('input_validation_warn');
        $(field).parents('.form-group').removeClass('input_validation_pass');
        if (!$(field).valid()) {
            $(field).parents('.form-group').addClass('input_validation_fail');
            isValid = false;
        } else {
            $(field).parents('.form-group').addClass('input_validation_pass');
        }
        if ($(field).attr('id') === 'Captcha' && ValidateCaptcha() == false) {
            isValid = false;
        }
        return isValid;
    }

    function ValidateSelects(field) {
        isValid = true;
        $(field).parents('.form-group').removeClass('input_validation_fail');
        if (!$(field).valid()) {
            $(field).parents('.form-group').addClass('input_validation_fail');
            isValid = false;
        } else {
            $(field).parents('.form-group').removeClass('input_validation_fail');
            $(field).parents('.form-group').addClass('input_validation_pass');
            $(field).parent().removeClass('input-validation-error');
        }
        if ($(field).attr('id') === 'DateOfBirthDay' || $(field).attr('id') === 'DateOfBirthMonth' || $(field).attr('id') === 'DateOfBirthYear') {
            ValidateDOB(field);
        }
        return isValid;
    }

    function ValidateTerms1(e) {
        var chbTerms = $("#Terms");
        if (!chbTerms.is(':checked')) {
            chbTerms.addClass('input-validation-error');
            $('#termsError').html('<span>L&#252;tfen Kurallar ve Şartları okuyup kabul ettiğinizi işaretleyiniz</span>');
            chbTerms.parents('.form-group').removeClass('input_validation_pass');
            chbTerms.parents('.form-group').addClass('input_validation_fail');
            return false;
        } else {
            $('#termsError').html('');
            chbTerms.removeClass('input-validation-error');
            chbTerms.val(chbTerms.is(':checked'));
            chbTerms.parents('.form-group').removeClass('input_validation_fail');
            chbTerms.parents('.form-group').addClass('input_validation_pass');
            return true;
        }
    }

    function ValidateDOB() {
        var msgCont = $('#drpDwnMsg');
        var inpBlock = msgCont.parents('.form-group ');
        let isError = false;
        for (let j = 0; j < $('.js_dob').length; j++) {
            if ($('.js_dob')[j].classList.contains('input-validation-error') && $('.js_dob')[j].value == '') {
                isError = true;
            }
        }
        if (isError) {
            msgCont.html('<span>L&#252;tfen doğduğunuz g&#252;n&#252; se&#231;iniz.</span>');
            if (!$(inpBlock).hasClass('input_validation_fail')) {
                inpBlock.removeClass('input_validation_pass');
                inpBlock.addClass('input_validation_fail');
            }
        } else {
            $('.js_dob').parents('.form-group').removeClass('input_validation_fail');
            $('.js_dob').removeClass('input-validation-error');
        }
    }

    function ValidateCaptcha() {
        let $captcha = $('#Captcha');
        $captcha.parents('.form-group').removeClass('input_validation_fail input_validation_warn input_validation_pass');
        if ($captcha.val().length == 0 || $captcha.val().length <= 4 || $captcha.val().length > 5) {
            $captcha.addClass("input-validation-error");
            $captcha.parents('.form-group').addClass('input_validation_fail');
            $('#recaptchaError').html('<span>G&#252;venlik kodu alanı boş veya verilen resimle uyuşmuyor.</span>');
            return false;
        } else {
            $captcha.removeClass("input-validation-error");
            $captcha.parents('.form-group').removeClass('input_validation_fail');
            $('#recaptchaError').html('');
            return true;
        }
    }

    function isCurrentStepFieldsValid() {

        var returnVal = true;
        $(inps).each(function () {
            if (ValidateFields(this) == false) {
                returnVal = false;
            }
            if ($(this).attr('id') === 'Terms' && ValidateTerms1() == false) {
                returnVal = false;
            }
            if ($(this).attr('id') === 'Captcha' && ValidateCaptcha() == false) {
                returnVal = false;
            }
        });

        if (sels.length !== 0) {
            $(sels).each(function () {
                if ($(this).attr('id') != 'countryNumber') {
                    if (ValidateSelects(this) == false) {
                        returnVal = false;
                    }
                }
            });
        }
        return returnVal;
    };

    function loadCities(obj) {
        let countryId = $(obj).val();
        $.ajax({
            url: "/Registration/GetCitiesAndDefaultCity",
            data: { countryId: countryId },
            contentType: "application/json",
            success: function (responce) {
                var html = '<option value>' + '-Şehir Se&#231;iniz-' + '</option>';
                $(responce.City).each(function () {
                    html += '<option value="' + this.Value + '">' + this.Text + '</option>';
                });
                $("#City").html(html);

                if (responce.DefaultCityId != 0) {
                    $('#City option[value=' + responce.DefaultCityId + ']').prop({ selected: true });
                    $('#City').trigger('change');
                }
            },
            error: function () {
                var html = '<option value>' + '-Şehir Se&#231;iniz-' + '</option>';
                $("#City").html(html);
            }
        });
    }

    function handleRegisterResponse(result) {
        if (result.Success) {
            switch (result.SuccessCode) {
                case 0:
                    if (result.RedirectUrl != '') {
                        document.location.href = result.RedirectUrl;
                    } else {
                        document.location.href = '/?deposit=1';
                    }
                    break;
                case 1:
                    createToast('error', 'Error', result.ErrorMessage, 4000);
                    break;
                case 2:
                    createToast('success', 'Tebrikler', 'Onaylama kodu başarıyla g&#246;nderildi.', 4000);
                    break;
            }
        } else {
            $('#Password').val('');
            $('#PasswordValidation').val('');
            if (result.ErrorType != '') {
                var spanElem = $('span[data-valmsg-for="' + result.ErrorType + '"]');
                if (spanElem.length > 0) {
                    spanElem.html('<span>' + result.ErrorMessage + '</span>');
                    if (result.ErrorType == 'DateOfBirth') {
                        $('#DateOfBirthDay').addClass('input-validation-error');
                        $('#DateOfBirthDay').parents('.form-group').addClass('input_validation_fail');
                        $('#DateOfBirthMonth').addClass('input-validation-error');
                        $('#DateOfBirthMonth').parents('.form-group').addClass('input_validation_fail');
                        $('#DateOfBirthYear').addClass('input-validation-error');
                        $('#DateOfBirthYear').parents('.form-group').addClass('input_validation_fail');
                    } else {
                        $('#' + result.ErrorType).addClass('input-validation-error');
                        $('#' + result.ErrorType).parents('.form-group').addClass('input_validation_fail');
                    }
                } else {
                    createToast('error', 'Error', result.ErrorMessage, 4000);
                }
            } else {
                createToast('error', 'Error', result.ErrorMessage, 4000);
            }
        }
        switch (result.CurrentStep) {
            case 'First':
                $('#js_cnt_btn').html('Devam');
                $('#js_back_btn').parent().addClass('hidden');
                fromWhere = 'First';
                break;
            case 'Second':
                $('#js_back_btn').parent().removeClass('hidden');
                $('#js_cnt_btn').html('Kodu Doğrula');
                fromWhere = 'Second';
                break;
            case 'Third':
                $('#js_back_btn').parent().removeClass('hidden');
                $('#js_cnt_btn').html('Devam');
                fromWhere = 'Third';
                break;
            case 'Fourth':
                $('#js_back_btn').parent().removeClass('hidden');
                $('#js_cnt_btn').html('Son');
                $('#Captcha').val('');
                $(".refresh-captcha").trigger('click');
                fromWhere = 'Fourth';
                break;
        }
        $('.D_reg_step').removeClass('showStep');
        $('#' + fromWhere).addClass('showStep');
    }

    if ('182' != '0') {
        $('#CountryCode option[value=' + '182' + ']').prop({ selected: true });
        $('#CountryCode').trigger('change');
    }

    if ('TRY' != '0') {
        $('#CurrencyCode option[value=' + 'TRY' + ']').prop({ selected: true });
        $('#CurrencyCode').trigger('change');
    }

    $('#Password').focusout(function () {
        if ($("#PasswordValidation").val() != '') {

            if ($("#PasswordValidation").val() == $('#Password').val()) {
                $("#PasswordValidation").closest('.form-group').removeClass('input_validation_fail').addClass('input_validation_pass');
            } else {
                $("#PasswordValidation").closest('.form-group').addClass('input_validation_fail');
            }
        }

    })
</script>
    <script type="text/javascript">
        $('#Captcha').addClass('tl_input_popup');
        $('#Captcha').attr('placeholder', 'Güvenlik Kodunu Giriniz');
        $('.refresh-captcha').html('<i class="tf_refresh_icon"></i>');

        $(".refresh-captcha").on("click",
