function setPayment(type, redirect = 0, form) {
    return new Promise(resolve => {
        if (!(form instanceof HTMLFormElement)) {
            // Eğer form bir form öğesi değilse, hatayı kontrol et ve işlemi durdur.
            console.error('form bir form öğesi değil');
            return;
        }

        const xhr = new XMLHttpRequest();
        let data = new FormData(form);
        data.append("type", type);
        xhr.open("POST", "/payment/request.php?q=payment");
        xhr.onload = function () {
            let res = this.responseText ? JSON.parse(this.responseText) : false;
            if (res.success) {
                if (redirect !== 1) {
                    console.log('dotdot');
                    form.submit();
                }
            } else {
                Swal.fire("Hata!", "Bilgileri doğru doldurduğunuza emin olun.", "error");
            }
            resolve();
        }
        xhr.send(data);
        event.preventDefault();
    })
}

